import { StrictMode } from 'react';
import ReactDOM from 'react-dom';

import App from './App';

const rootElement = document.getElementById('root');
ReactDOM.render(
  <StrictMode
    style={{
      border: '1px solid',
      padding: '200px',
      display: 'flex',
      justifyContent: 'center'
    }}
  >
    <App />
  </StrictMode>,
  rootElement
);
